import React,{useState,useEffect} from 'react';
import axios from 'axios'

function GroupOfCountries() {
 const [countries,setCountry]=useState([]);


    const fetchData=async()=>{
      const response = await fetch("https://restcountries.com/v2/all");
      const data = await response.json();
      setCountry(data);
    }

    console.log(countries);
    useEffect(()=>{
       try{
          fetchData();
       }catch(error){
          console.log(error);
       }
    },[])

    return (
        <div className="countries">
           {countries.map((country)=>{
               return (
                <>
                 <div className="flag_container">
                 <img src={country.flag} alt=""/>
              </div>

              <div className="details">
              <h3 className="name">{country.name}</h3>
              <p>Population:{""} <span className="values">{country.population}</span></p>
             <p>Regions:{""} <span className="values">{country.population}</span></p>
             <p>Capital:{""} <span className="values">Test</span></p>

        </div>
              </>
               )

           })}

    </div>
    )
}

export default GroupOfCountries
